        var BlogImageModule;

        BlogImageModule = {
            init: function(element) {
                if ($(element).length > 0) {
                    this.el = $(element);
                } else {
                    return;
                }
                this.isAnimting = false;
                this.currentSlide = 0;
                this.previousSlide = 0;
                this.slides = this.el.parents('.section-wrapper').find('.section-content-image--proveit');
                this.slideTitles = this.el.find('.project-location-link');
                this.links = this.el.find('.project-link');
                this.slides.addClass('ready');
                this.slides.eq(this.currentSlide).addClass('active');
                this.links.each((index, item) => {
                    return $(item).attr('data-proveit-id', index);
                });
                this.links.mouseenter((e) => {
                    var targetId;
                    targetId = $(e.target).closest('.project-link[data-proveit-id]').attr('data-proveit-id');
                    this.slides.removeClass('active');
                    return this.slides.eq(targetId).addClass('active');
                });
                this.slides.removeClass('active');
                return this.slides.eq(this.currentSlide).addClass('active');
            }
        };

        module.exports = BlogImageModule;


